import "./Home.css";
import React, { Component } from 'react';
import axios from 'axios';
import {Routes, Route, useNavigate} from 'react-router-dom';

class Home extends Component {

    // let navigate = useNavigate();
    // const handleLogin = () => {
    //     let path = './login'
    //     navigate(path);
    // }

    navigate = useNavigate();
    handleSignup = () => {
        path = './signup';
        navigate(path);
    }

    render() {
        return (
            <div className="tv-1">
                <div className="tv-1-child">
                    <h1 className="lets-get-you">Which page do you want to go?</h1>
                
                    <button className="loginButton" onClick={this.handleLogin}>
                        <div className="login-wrapper">
                        <div className="login">Login to existing Account.</div>
                        </div>
                    </button>

                    <button className="signupbutton" onClick={this.handleSignup}>
                        <div className="signup-wrapper">
                        <div className="signup">Create an Account</div>
                        </div>
                    </button>
                </div>
            </div>
        );
    }
}

export default Home;
